titulo_facebook:
 ¿Quién tiene que estar presente en la casa durante el censo?  El censo puede ser respondido por cualquiera de las personas que habitan la vivienda, aunque idealmente se espera que lo responda el jefe de hogar. Esta es una figura que sólo se utiliza para determinar la relación de parentesco que tienen las demás personas que comparten el hogar y es designada por los mismos residentes de la vivienda. Lo importante es que en todo momento haya alguien que pueda responder las preguntas del censista.
